import React from 'react'
import AppBar from '@material-ui/core/AppBar';
import { Toolbar, Typography, Button, CardMedia } from '@material-ui/core';
import "fontsource-poppins";
import logo from '../images/navlogo.png'
import PersonIcon from '@material-ui/icons/Person';


const Navbar = (props) => (

    <AppBar position="static" style={{ 'backgroundColor': "#393b44", 'fontFamily': "poppins" }}>
        <Toolbar>
            <img src={logo} style={{ 'maxWidth': "50px", 'maxHeight': "50px" }} />
            <CardMedia
                image="https://images.unsplash.com/photo-1601758064955-a4a16da74a86?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1950&q=80"
                title="Paella dish"
            />
            <Typography variant="h5" style={{ 'fontFamily': "poppins", "color": "#f1f3f8" }}>
                SyntaxMeets
            </Typography>
            <Button variant="contained" startIcon={<PersonIcon />} style={{ 'marginLeft': "auto", 'fontFamily': "poppins", 'fontWeight': "600", 'color': "#f1f3f8", 'backgroundColor': "#99A3CD" }}>

                Login</Button>
        </Toolbar>
    </AppBar>
)

export default Navbar;
